export default {
  name: 'Icon',

  functional: true,

  props: {
    color: {
      type: String,
      required: false,
      default: null,
    },

    name: {
      type: String,
      required: true,
    },

    size: {
      type: String,
      required: false,
      default: null,
    },

    title: {
      type: String,
      required: false,
      default: null,
    },
  },

  render (h, { props: { color, name, size, title } }) {
    return (
      <svg
        class="icon"
        style={{
          'fill': color,
          'font-size': size,
        }}
      >
        <title>
          { title || name }
        </title>

        <use xlinkHref={`#icon-${name}`} />
      </svg>
    )
  },
}
